  }
  render() {
    if(document.querySelector(".chubsy-wrapper-nav") != undefined) {
      document.querySelector(".chubsy-wrapper-nav").style.backgroundColor = "rgba(255, 255, 255, 0.6)";
    }
    return (
      <div className="about-wrapper">hello!</div>
    );
  }
}

